How to find MongoDB documents in one collection not referenced by documents in another collection?<p>I am looking for an efficient way in MonogDB to determine, which documents in one collection are not referenced by documents in another collection.</p>

<p>The database comprises two collections, <code>inventory</code> and <code>tags</code>, where some (not all) documents in <code>inventory</code> reference one of the <code>tags</code> documents:</p>

<pre><code>{
    "_id" : ObjectId("5e8df3c02e197074f39f61ea"), 
    "tag" : ObjectId("5e89a1af96d5d8b30aead768"), 
    "ean" : "5707196199178", 
    "location" : "shelf 1"
},
{
    "_id" : ObjectId("5e8df211727079cdc24e20e1"), 
    "ean" : "5707196199178", 
    "location" : "shelf 1"
}
</code></pre>

<p>The 'tags' documents are without any reference to documents in <code>inventory</code>:</p>

<pre><code>{
    "_id" : ObjectId("5e7d174fc63ce5b0ca80b89a"), 
    "nfc" : { "id" : "04:5f:ae:f2:c2:66:81" }, 
    "barcode" : { "code" : "29300310", "type" : "EAN8" }
},
{
    "_id" : ObjectId("5e89a1af96d5d8b30aead768"), 
    "nfc" : { "id" : "04:48:af:f2:c2:66:80" }, 
    "barcode" : { "code" : "29300716", "type" : "EAN8" }
},
{
    "_id" : ObjectId("5e7d1756c63ce5b0ca80b89c"), 
    "nfc" : { "id" : "04:02:ae:f2:c2:66:81" }, 
    "barcode" : { "code" : "29300648", "type" : "EAN8" }
}
</code></pre>

<p>Since not all documents in <code>tags</code> are used in <code>inventory</code> documents, I cannot simply have them as sub-documents.</p>

<p>Now I need to determine, which of the <code>tags</code> documents are <strong>not</strong> referenced by any <code>inventory</code> document. I would prefer not to have to maintain back references from <code>tags</code> to <code>inventory</code> to not risk inconsistencies (unless this can be done automatically by MongoDB?).</p>

<p>I'm very new to MongoDB, and from I've learned so far I'm under the impression that a view is probably what I need. But I seem to lack the proper search terms to find examples that help me understand enough to proceed. Maybe I need something different, here I'm hoping for your input to point me in the right direction.</p>

