MongoDB $cond with embedded document array<p>I am trying to generate a new collection with a field 'desc' having into account a condition in field in a documment array. To do so, I am using <strong>$cond</strong> statement</p>

<p>The origin collection example is the next one:</p>

<pre><code>{
        "_id" : ObjectId("5e8ef9a23e4f255bb41b9b40"),
        "Brand" : {
                "models" : [
                        {
                                "name" : "AA"
                        },
                        {
                                "name" : "BB"
                        }
                ]
        }
}
{
        "_id" : ObjectId("5e8ef9a83e4f255bb41b9b41"),
        "Brand" : {
                "models" : [
                        {
                                "name" : "AG"
                        },
                        {
                                "name" : "AA"
                        }
                ]
        }
}
</code></pre>

<p>The query is the next:</p>

<pre><code>db.runCommand({
    aggregate: 'cars',
    'pipeline': [
        {
            '$project': {
                'desc': {
                    '$cond': {
                        if: {
                            $in: ['$Brand.models.name',['BB','TC','TS']]
                        },
                        then: 'Good',
                        else: 'Bad'
                    }
                }
            }
        },
        {
            '$project': {
                'desc': 1
            }
        },
        {
            $out: 'cars_stg'
        }
    ],
    'allowDiskUse': true,
})
</code></pre>

<p>The problem is that the <strong>$cond</strong> statement is always returning the "else" value. I also have tried <strong>$or</strong> statement with <strong>$eq</strong> or the <strong>$and</strong> with <strong>$ne</strong>, but is always returning "else".</p>

<p>What am I doing wrong, or how should I fix this?</p>

<p>Thanks</p>

