<pre><code>const { Schema, model } = require('mongoose')

const schema = new Schema({
  title: {
    type: String,
    required: true
  },
  type: {
    type: String,
    default: false
  },
  price: {
    type: Number,
    default: false
  }
})

module.exports = model('Rent', schema)
</code></pre>

<p>html of available :</p>

